import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Login from './auth/Login';

const Main = () => {
    <main>
        <Switch>
            <Route exact path='/' component={Login} ></Route>
        </Switch>
    </main>
}

export default Main;
